content.css:
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
table {
  width: 100%;
  border-collapse: collapse;
}
td {
  text-align: left;
  padding-left: 5px;
}
tr:nth-child(even) {
  background-color: #f2f2f2;
}
tr:hover {
  background-color: #ddd;
}
tr:last-child {
  font-weight: bold;
  border-top: black;
  border-top-width: 1px;
}
th {
  padding-top: 12px;
  padding-bottom: 12px;
  text-align: center;
  background-color: #744EC2;
  color: white;
}
